  input: TEXT,F3XT,,"This is the final FEC filing for the DynPAC, which was terminated
    in April following the divestiture by the connected organization, Computer Sciences
    Corp., of certain business units which comprised the majority of the DynPAC members.  The
    remaining DynPAC members, who are Computer Sciences Corp. employees, have had
    their membership transferred to the CSC PAC, with which the DynPAC was an affiliated
    PAC.  Per the guidance given on 7/13/05 by our FEC Campaign Finance Analyst, Christopher
    Morse, we will keep track of contributions from former DynPAC members who are
    now CSC PAC members, to ensure that their contributions to both affiliate PACs
    do not exceed the individual annual PAC contribution limits."
